// PAGE JS
var isTouch,
    docWidth,
    docHeight,
    resizeTimer,
    partnerCarousel,
    partnerCarouselSet;
isTouch = 'ontouchstart' in window || navigator.msMaxTouchPoints; // IE10 compatible
docWidth = $(window).width();
docHeight = $(window).height();
// function for when the page is resized
function resizeFunction() {
    // update current window sizes
    docWidth = $(window).width();
    docHeight = $(window).height();
    // menus
    $('#header-top .wrap > ul, #header-middle nav .wrap > ul, #header-middle nav .wrap > ul > li, #header-middle nav .wrap > ul > li ul, .dropdown, .dropdown *, .top-info *').attr('style','').removeClass('hover');
    
    
    // top search form
    if(docWidth>880){
        $('.top-info form input[type=submit]').off('click').on('click',function(e){
            e.preventDefault();
            $('.top-info form').submit();
        });
    } else {
        $('.top-info form input[type=submit]').addClass('closed').off('click').on('click',function(e){
            e.preventDefault();
            if($(this).hasClass('closed')){
                $('.top-info form').animate({ width: '250px'},300);
                $('.top-info form input[type=text], .top-info form input[type=search]').animate({ 
                    width: '210px',
                    opacity: '1'
                },300);
                $(this).removeClass('closed');
            } else {
                $('.top-info form').animate({ width: '40px'},300);
                $('.top-info form input[type=text], .top-info form input[type=search]').animate({ 
                    width: '0px',
                    opacity: '0'
                },300);
                $(this).addClass('closed')
                $('.top-info form').submit();
            };
        });
    };    
};
$(window).resize(function(){clearTimeout(resizeTimer);resizeTimer=setTimeout(resizeFunction,200);});
if(Modernizr.touch){
    window.addEventListener("orientationchange", function() { clearTimeout(resizeTimer);resizeTimer=setTimeout(resizeFunction,200);}, false);
}
// function for when the page loads
$(document).ready(function(){
    // menu
    if($('#header-middle nav .wrap > ul > li.active').is('.treatment-specialities')){
        $('.dropdown, .dropdown .treatment-specialities').addClass('open');
    }
    $('#header-middle nav').on('mouseleave',function(e){
        if(docWidth>900){
            if($('.consultant select').is(':focus')||$('.treatment select').is(':focus')){
                
            } else if($('#header-middle nav .wrap > ul > li.active').is('.treatment-specialities')){
                $('.dropdown > div').removeClass('open');
                $('.dropdown .treatment-specialities').addClass('open');
            } else {
                $('#header-middle nav .wrap > ul > li').removeClass('hover');
                $('.dropdown > div').removeClass('open');
                $('.dropdown').removeClass('open');
            }
        }
    })
    $('#header-middle nav .wrap > ul > li > a').on('click',function(e){
        if(docWidth>900&&$(this).parent('li').hasClass('hover')){
            if($('#header-middle nav .wrap > ul > li.active').is('.treatment-specialities')){
                $('.dropdown > div').removeClass('open');
                $('.dropdown .treatment-specialities').addClass('open');
            } else {
                $('#header-middle nav .wrap > ul > li').removeClass('hover');
                $('.dropdown > div').removeClass('open');
                $('.dropdown').removeClass('open');
            }
        }
        if($(this).siblings('ul').length>0){
            if(docWidth<=900){
                if($(this).siblings('ul').length>0){
                    e.preventDefault();
                    $(this).siblings('ul').stop(true,false).slideToggle(500);
                }
            } else {
                e.preventDefault();
                var className = $(this).parent('li').attr('class').replace('active','').replace('hover','').replace(' ','');
                if(!$('.dropdown '+className).hasClass('hover')){
                    $('#header-middle nav .wrap > ul > li').removeClass('hover');
                    if($('#header-middle nav .wrap > ul > li.active').is('.treatment-specialities')){
                        if($('.dropdown .'+className).length>0){
                            $(this).parent('li').addClass('hover');
                            $('.dropdown > div').removeClass('open');
                            $('.dropdown .'+className).addClass('open');
                        } else {
                            $('.dropdown > div').removeClass('open');
                            $('.dropdown .treatment-specialities').addClass('open');
                        }
                    } else {
                        if($('.dropdown .'+className).length>0){
                            $(this).parent('li').addClass('hover');
                            $('.dropdown > div').removeClass('open');
                            $('.dropdown .'+className).addClass('open');
                            if(!$('.dropdown').hasClass('open')){
                                $('.dropdown').addClass('open');
                            }
                        } else {
                            $('.dropdown > div').removeClass('open');
                            if($('.dropdown').hasClass('open')){
                                $('.dropdown').removeClass('open');
                            }
                        }
                    }
                }
            }
        }
    }).on('mouseenter',function(e){
        if(docWidth>900){
            e.preventDefault();
            var className = $(this).parent('li').attr('class').replace('active','').replace('hover','').replace(' ','');
            if(!$('.dropdown '+className).hasClass('hover')){
                $('#header-middle nav .wrap > ul > li').removeClass('hover');
                if($('#header-middle nav .wrap > ul > li.active').is('.treatment-specialities')){
                    if($('.dropdown .'+className).length>0){
                        $(this).parent('li').addClass('hover');
                        $('.dropdown > div').removeClass('open');
                        $('.dropdown .'+className).addClass('open');
                    } else {
                        $('.dropdown > div').removeClass('open');
                        $('.dropdown .treatment-specialities').addClass('open');
                    }
                } else {
                    if($('.dropdown .'+className).length>0){
                        $(this).parent('li').addClass('hover');
                        $('.dropdown > div').removeClass('open');
                        $('.dropdown .'+className).addClass('open');
                        if(!$('.dropdown').hasClass('open')){
                            $('.dropdown').addClass('open');
                        }
                    } else {
                        $('.dropdown > div').removeClass('open');
                        if($('.dropdown').hasClass('open')){
                            $('.dropdown').removeClass('open');
                        }
                    }
                }
            }
        }
    })
    
    $("ul.tabs").tabs("div.panes > div", {effect: 'fade', current: 'current'});
    
    // accordion
    $('.brochure-download').smk_Accordion({
        activeIndex: 1,
        closeAble: true
    });
    
    // initiate bxslider
    $('.slider, #featured-history').bxSlider({
        auto: true,
        mode:'fade',
        pager: true,
        pause: 10000
    });
    // dropdown menu
    $('#header-middle nav .wrap > a').click(function(e){
        e.preventDefault();
        $(this).siblings('ul').stop(true,false).slideToggle(500);
    });
    // menu forms
    $('form.consultant input[type=text]').on('focus',function(e){
        if($(this).attr('value')===$(this).attr('placeholder')){
            $(this).attr('value','');
        }
    }).on('blur',function(e){
        if($(this).attr('value')===$(this).attr('placeholder')||$(this).attr('value')===''){
            $(this).attr('value',$(this).attr('placeholder'));
        }
    });
    
    $('form.consultant select').change(function(e){
        $('form.consultant').submit();
    });
    $('form.treatment select').change(function(e){
        window.location.replace($('form.treatment select option:checked').attr('value'));
    });
    // call the reize function for the first time
    resizeFunction();
    
    $("#nurseTeam .nurseTeam-box:nth-child(4n+5)").addClass("noRightMargin");
    $(".executiveTeam-box:nth-child(3n)").addClass("noRightMargin");
    $("#tour .virtul-tour:nth-child(2n)").addClass("noRightMargin");
    $("#video-podcasts .video-podcasts-list:nth-child(2n)").addClass("noRightMargin");
    
    	$('a.fancybox').fancybox({
        width: 550,	
        height: 190,
        padding: [50, 40, 50, 40],	
        autoSize: false,
        loop: true,
        type: 'inline',
        scrolling: 'no',
        mouseWheel: false,		
        openEffect: 'fade',
        closeEffect: 'fade',	
        nextEffect: 'none',
        prevEffect: 'none',
        nextSpeed: 750,
        prevSpeed: 750,		
        beforeShow   : function() {
         $('.fancybox-inner .content .description, .description-pane').each(
            function()
            {
             $(this).jScrollPane();
             var api = $(this).data('jsp');
             var throttleTimeout;
             $(window).bind(
              'resize',
              function()
              {
               if (!throttleTimeout) {
                throttleTimeout = setTimeout(
                 function()
                 {
                  api.reinitialise();
                  throttleTimeout = null;
                 },
                 50
                );
               }
              }
             );
            }
           )
        }
       });	

       $(window).resize(toggleOverlay);
       toggleOverlay();	

      /**
       * Toggles overlay 
       */
      function toggleOverlay(){
       var link = $('.executiveTeam-box a.content');
      }
      
      $('.scroll').each(
            function()
            {
             $(this).jScrollPane();
             var api = $(this).data('jsp');
             var throttleTimeout;
             $(window).bind(
              'resize',
              function()
              {
               if (!throttleTimeout) {
                throttleTimeout = setTimeout(
                 function()
                 {
                  api.reinitialise();
                  throttleTimeout = null;
                 },
                 50
                );
               }
              }
             );
            }
           )
       var jcarousel = $('.jcarousel');

        jcarousel.on('jcarousel:reload jcarousel:create', function () {
                var width = jcarousel.innerWidth();

                if (width >= 600) {
                    width = width / 3;
                } else if (width >= 350) {
                    width = width / 2;
                }

                jcarousel.jcarousel('items').css('width', width + 'px');
            })
            .jcarousel({
                wrap: 'circular'
            });

        $('.jcarousel-control-prev')
            .jcarouselControl({
                target: '-=1'
            });

        $('.jcarousel-control-next')
            .jcarouselControl({
                target: '+=1'
            });
});




